#!/usr/bin/env perl
use strict;

my %true;
while(<DATA>)
{
	$true{$1} = $2 if m/^(\d{9})\s(.+)/;
}

my $infile = shift;
open(IN, $infile) or die $!;
my $sam = $1 if $infile =~ m/\b(\d{9})\b/;
die "sample $sam not in true set\n" unless $true{$sam};
while(<IN>)
{
	chomp;
	my @solution = split('\t', $_);
	if($solution[0] == 1 && $solution[1])
	{
		my $type = $solution[1];
		my $type2 = $type;
		$type2 =~ s/;.+//;
		$type2 =~ s/\D+$//;
		my $gene = $1 if $type2 =~ m/(.+)\*/;
		if(index($true{$sam}, $gene) != -1)
		{
			if(index($true{$sam}, $type2) != -1)
			{
				print "$sam\t$_\tcorrect\n";
			}else
			{
				print "$sam\t$_\twrong\n";
			}
		}else
		{
			print "$sam\t$_\tmissing\n";
		}
	}
}



